        return new Source("{% extends 'base.html.twig' %}

{% block title %}Product index{% endblock %}

{% block body %}
    <h1>Product index</h1>
    <div class=\"container\">
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Price</th>
                <th>Images</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for product in products %}
            <tr>
                <td>{{ product.id }}</td>
                <td>{{ product.name }}</td>
                <td>{{ product.price }}</td>
                <td>{% for image in product.productImages %}
                        <img height=\"70\" src=\"{{ asset('images/'~image.image) }}\" />
                    {% endfor %}
                </td>
                <td>
                    <a href=\"{{ path('app_crud_product_show', {'id': product.id}) }}\">show</a>
                    <a href=\"{{ path('app_crud_product_edit', {'id': product.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"4\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_crud_product_new') }}\">Create new</a>
    </div>
{% endblock %}
", "crud_product/index.html.twig", "/var/www/html/Dennis/myShop/templates/crud_product/index.html.twig");
